--  DDL for View CARTVIEW
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "CHEFJ"."CARTVIEW" ("USER_ID", "PID", "P_NAME", "P_PRICE", "QUANTITY", "CATE_IN_ID", "F_NAME") AS 
  select user_id, c.pid, p.p_name, p.p_price, c.quantity, p.cate_in_id, a.f_name
from cart c
left join product p on(c.pid=p.pid)
join attachment a on(c.pid=a.bprc_id)
;
--------------------------------------------------------
--  DDL for View MLIST
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "CHEFJ"."MLIST" ("RNUM", "M_NO", "M_ID", "M_NAME", "M_ENT_DATE", "EMAIL", "PHONE", "ADDR", "GENDER", "NICKNAME", "BIRTH", "M_GRADE", "M_OUT_DATE", "M_STATUS", "M_INTRO", "SUM(TOTAL_PRICE)") AS 
  SELECT ROWNUM RNUM, A."M_NO",A."M_ID",A."M_NAME",A."M_ENT_DATE",A."EMAIL",A."PHONE",A."ADDR",A."GENDER",A."NICKNAME",A."BIRTH",A."M_GRADE",A."M_OUT_DATE",A."M_STATUS",A."M_INTRO",A."SUM(TOTAL_PRICE)"
FROM(SELECT M_NO, M_ID, M_NAME, M_ENT_DATE, EMAIL, PHONE, ADDR, GENDER, NICKNAME, BIRTH, M_GRADE, M_OUT_DATE, M_STATUS, M_INTRO , SUM(TOTAL_PRICE)
FROM MEMBER M
LEFT JOIN SHOPPING_ORDER ON(ORDER_MEMBER=M_NO) 
GROUP BY M_NO, M_ID, M_NAME, M_ENT_DATE, EMAIL, PHONE, ADDR, GENDER, NICKNAME, BIRTH, M_GRADE, M_OUT_DATE, M_STATUS, M_INTRO
ORDER BY TO_NUMBER(SUBSTR(M_NO ,2))) A
;
--------------------------------------------------------
--  DDL for View NDETAIL
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "CHEFJ"."NDETAIL" ("N_ID", "N_TITLE", "N_CONTENT", "M_NO", "M_ID", "N_DATE", "N_COUNT", "N_STATUS") AS 
  SELECT N_ID, N_TITLE, N_CONTENT, M_NO, M_ID,
           N_DATE, N_COUNT, N_STATUS
    FROM NOTICE N
    JOIN MEMBER M USING(M_NO)
    WHERE N.N_STATUS = 'Y'
;
--------------------------------------------------------
--  DDL for View NLIST
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "CHEFJ"."NLIST" ("RNUM", "N_ID", "N_TITLE", "N_CONTENT", "M_NO", "M_ID", "N_DATE", "N_COUNT", "N_STATUS") AS 
  SELECT ROWNUM RNUM, A."N_ID",A."N_TITLE",A."N_CONTENT",A."M_NO",A."M_ID",A."N_DATE",A."N_COUNT",A."N_STATUS"
    FROM (SELECT  N_ID, N_TITLE, N_CONTENT, M_NO, M_ID, N_DATE, N_COUNT, N_STATUS
    FROM NOTICE N
    JOIN MEMBER USING(M_NO)
    ORDER BY TO_NUMBER(SUBSTR(N_ID,2)) DESC) A
;
--------------------------------------------------------
--  DDL for View QDETAIL
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "CHEFJ"."QDETAIL" ("Q_ID", "Q_CATE", "Q_TITLE", "Q_CONTENT", "M_ID", "ORDER_ID", "Q_DATE", "A_STATUS", "A_CONTENT", "A_DATE") AS 
  SELECT Q_ID, Q_CATE, Q_TITLE, Q_CONTENT, M_ID, ORDER_ID,
           Q_DATE, A_STATUS, A_CONTENT, A_DATE
    FROM QUESTION
    JOIN MEMBER USING(M_NO)
    LEFT JOIN ANSWER USING(Q_ID)
;
--------------------------------------------------------
--  DDL for View QLIST
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "CHEFJ"."QLIST" ("RNUM", "Q_ID", "Q_TITLE", "M_NO", "M_ID", "Q_DATE", "Q_CATE", "A_STATUS") AS 
  SELECT ROWNUM RNUM, A."Q_ID",A."Q_TITLE",A."M_NO",A."M_ID",A."Q_DATE",A."Q_CATE",A."A_STATUS"
    FROM (SELECT  Q_ID, Q_TITLE, M_NO, M_ID, Q_DATE, Q_CATE, A_STATUS
    FROM QUESTION B
    JOIN MEMBER USING(M_NO)
    ORDER BY TO_NUMBER(SUBSTR(Q_ID,2)) DESC) A
;
--------------------------------------------------------
--  DDL for View RECIPELIST
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "CHEFJ"."RECIPELIST" ("RNUM", "R_ID", "R_NAME", "M_NO", "R_LIKE", "R_COUNT") AS 
  SELECT ROWNUM RNUM, A."R_ID",A."R_NAME",A."M_NO",A."R_LIKE",A."R_COUNT"
    FROM(SELECT R_ID, R_NAME, M_NO, R_LIKE, R_COUNT
        FROM RECIPE R
        ORDER BY R_ID DESC) A
;
--------------------------------------------------------
--  DDL for View RECIPEVIEW
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "CHEFJ"."RECIPEVIEW" ("R_ID", "R_NAME", "M_NO", "NICKNAME", "R_INFO", "R_COOKTIME", "R_COOKLEVEL", "CATE_IN_ID", "CATE_FO_ID", "CATE_METHOD_ID", "R_DATE", "R_COUNT", "R_LIKE", "R_STATUS", "R_IN_NAME", "R_WEIGHT", "S_ID", "S_STEP", "S_DESC") AS 
  SELECT R_ID, R_NAME, M_NO, NICKNAME, R_INFO, R_COOKTIME, R_COOKLEVEL, CATE_IN_ID, CATE_FO_ID, CATE_METHOD_ID,
R_DATE, R_COUNT, R_LIKE, R_STATUS, R_IN_NAME, R_WEIGHT, S_ID, S_STEP, S_DESC
FROM RECIPE
left join member using(m_no)
left JOIN RECIPE_STEP USING(R_ID)
left JOIN RECIPE_INGREDIENT USING(R_ID)
;
